import Navop from './components/Navop.js';


function Nav ()  {
const type = ["Home","Products","ContactUs"];
return(
    <div className="flex bg-black text-white justify-around">

  {type.map((type)=>{return<Navop name={type}></Navop>}) }
  <input type="text" className=" my-2 rounded-full border-style:solid border-2 border-purple-800 text-black"></input>
    </div>
)
}

export default Nav;
